	(94, 'inquiry', 93, 2, 1, 'N', '', 'admin', '최고관리자', NULL, '', '견적문의', '<div>안녕하세요.<br />\r\n<br />\r\n사업자등록증 사본 부탁드립니다.<br />\r\n<br />\r\n메일보내드렸습니다.<br />\r\n<br />\r\n감사합니다<br />\r\n<br />\r\n<br />\r\n메일보내드렸는데 메일주소가 잘못 기재되었는지 전송이 안되었네요.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>고기접시 23*23&nbsp; &nbsp; 200 * 8,880 = 1,776,000원(부가세별도)<br />\r\n사각쿠프 4호&nbsp; &nbsp; &nbsp; &nbsp; 200 * 3,950 =&nbsp; &nbsp; 790,000원(부가세별도)<br />\r\n<br />\r\n1. 본 견적서의 유효기간은 30일입니다.<br />\r\n2. 배송비는 별도입니다.<br />\r\n3. 최소수량은 각 200개 입니다.<br />\r\n<br />\r\n자세한 문의는 031-593-5611</div>\r\n\r\n<div>담당 전유리과장 입니다.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>(점심시간은 1시~2시 입니다)<br />\r\n&nbsp;</div>\r\n', 'H', 'N', '', 0, 0, '118.32.160.35', '2025-06-23 08:53:51', NULL, NULL, '', '', '', '', 'N', '', '', NULL, NULL, ''),
	(95, 'notice', 0, 1, 0, 'Y', NULL, 'admin', '최고관리자', NULL, '', '견적요청시 필요서류', '안녕하세요<br />\r\n<br />\r\n당사 홈페이지를 방문해 주셔서 감사드립니다.<br />\r\n<br />\r\n견적서를 요청하실때는 사업자등록증 사본을 첨부해<br />\r\n<br />\r\n주시길 요청드립니다.<br />\r\n<br />\r\n감사합니다.', 'H', 'N', '', 16, NULL, '118.32.160.35', '2025-06-23 10:01:41', NULL, NULL, NULL, 'N', '', '', 'N', NULL, '', NULL, NULL, ''),
	(96, 'inquiry', NULL, NULL, 0, 'N', NULL, NULL, '강준모', NULL, NULL, '견적문의드립니다.', '안녕하세요 코베아 영업부 강준모차장입니다.\r\n\r\n코베아는 가스기구류 등 캠핑용품을 제조 판매하고 있는 국내기업입니다.\r\n\r\n큐브가스레인지라는 소형 버너를 이마트에 납품하고 있는데\r\n\r\n이번에 오뎅전용냄비와 함께 세트를 기획하고 있습니다.\r\n\r\n180, 200 두 모델 요청드립니다\r\n\r\n제품은 저희쪽에서 받아서 버너와 함께 포장할 예정이며\r\n\r\n수량은 2,000EA 입니다.\r\n\r\n감사합니다', 'H', 'Y', '$2y$10$U0FhTdmAHaak2AfYMzgBRuoeDc6TVAiagh8ACbinFhl6zpODhfaEO', 2, NULL, NULL, '2025-07-01 17:30:09', NULL, NULL, NULL, 'N', NULL, NULL, 'N', NULL, NULL, '68639c913ee5d4.32788480.pdf', '(주)코베아-사업자등록증명.pdf', NULL),
	(97, 'inquiry', 96, 1, 1, 'N', '', 'admin', '최고관리자', NULL, '', '견적문의드립니다.', '안녕하세요<br />\r\n<br />\r\n문의글 남겨주셔서 감사드립니다.<br />\r\n<br />\r\n오뎅전용냄비는<br />\r\n<br />\r\n경질피막처리된 경질샤브샤브냄비와<br />\r\n<br />\r\n통삼중재질로 된 삼중샤브샤브냄비가 있습니다.<br />\r\n<br />\r\n경질샤브샤브냄비는<br />\r\n180mm&nbsp; 14,700원<br />\r\n200mm&nbsp; 16,600원<br />\r\n<br />\r\n삼중샤브샤븐냄비<br />\r\n180mm&nbsp; 11,200원<br />\r\n200mm&nbsp; 12,100원<br />\r\n<br />\r\n사이즈별 2,000개 기준입니다.<br />\r\n<br />\r\n본 견적의 유효기간은 30일 입니다<br />\r\n<br />\r\n더 궁금하신 사항이 있으면 아래 담당자에게 연락주시기 바랍니다.<br />\r\n<br />\r\n감사합니다<br />\r\n<br />\r\n010 8973 9122<br />\r\nCFO 오다연&nbsp;', 'H', 'N', '', 0, 0, '118.32.160.35', '2025-07-02 08:44:33', NULL, NULL, '', '', '', '', 'N', '', NULL, NULL, NULL, NULL),
	(98, 'inquiry', NULL, NULL, 0, 'N', NULL, NULL, '이진희', NULL, NULL, '칼리버후라이팬', '예전에 구매했던 칼리버후라이팬 11인치 \r\n손잡이길이 24센치 ☆ \r\n구매하고싶은데 있을까요??', 'H', 'Y', '$2y$10$1yrEvL4.a9KtC4ABzmgjFeKKcHaYj5MWt9PtHqxLsc9wis0gadiBC', 0, NULL, NULL, '2025-07-08 15:48:23', NULL, NULL, NULL, 'N', NULL, NULL, 'N', NULL, NULL, '686cbf37432511.60054631.jpeg', 'IMG_3670.jpeg', NULL),
